import React from 'react';
import Button from '@material-ui/core/Button';
import {StyleLoginButton} from './StyleLogin'
const LoginIndex = () => {
    
    return (
        <StyleLoginButton>
            <Button >Sign in</Button>
        </StyleLoginButton>
    );
}

export default LoginIndex;
